E_D("replace into `phome_ecms_game` values('3786','14','0','','','','1','admin','','1','0','1343236641','0','0','0','0','','','3786','0','0','0','0','0','0','小草','1343236641','/spic/20120725/2262.jpg','0','1','1343236641','0','3','1','0','','0','','/d/file/swf/11.swf','667','479','没有花香没有树高<br />我是一棵无人知道的小草<br />从不寂寞从不烦恼<br />你看我的伙伴遍及天涯海角<br />春风啊春风你把我吹绿<br />阳光啊阳光你把我照耀<br />河流啊山川你哺育了我<br />大地啊母亲把我紧紧拥抱<br />没有花香没有树高<br />我是一棵无人知道的小草<br />从不寂寞从不烦恼<br />你看我的伙伴遍及天涯海角<br />春风啊春风你把我吹绿<br />阳光啊阳光你把我照耀<br />河流啊山川你哺育了我<br />大地啊母亲把我紧紧拥抱<br />小草三十年走到今天来<br />越过了山峰飞过了大海<br />发现远方的人走着一条路<br />小草站起来合成一棵树<br />春风啊春风你把我吹绿<br />阳光啊阳光你把我照耀<br />河流啊山川你抚育了我<br />大地啊母亲把我紧紧拥抱','1','','0','','1','/dpic/20120725/2263.jpg','9492','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhoTWVrVjRURzVPTTFwblBUMD0=','0','0','http://s.61baobao.com/zt/qinbao/2011/11.swf','http://www.61baobao.com/zt/qinbao/2011/dpic/11.jpg','http://www.61baobao.com/zt/qinbao/2011/pic/11.jpg','0','三个月以上','0','','0','','0','0','0');");
