E_D("replace into `phome_ecms_game` values('3789','16','0','','','','1','admin','','1','0','1343236642','0','0','0','0','','','3789','0','0','0','0','0','0','魔鬼和它的祖母','1343236642','/spic/20120725/2274.gif','0','1','1343236642','0','3','1','0','','0','','/d/file/swf/shuqingwa.swf','667','479','从前爆发了一场大战，国王招募了许多士兵，而发给士兵的军饷少得可怜，士兵简直无以聊生。于是，三个士兵相约逃跑。只听一个士兵对另两个说：“如果我们被抓住，就会被绞死，怎样才能顺利地逃走呢？”另一个说：“瞧那边不是块玉米地吗？如果我们藏到里面，谁能找到我们？再说，部队又不许进入玉米地，何况明天他们就要出发了！”他们偷偷溜进了玉米地。来自','1','','0','','1','/dpic/20120725/2275.gif','8902','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5PYjJSWVJuQmliV1F6V1ZNMWVtUXlXVDA9','0','0','http://s.61baobao.com/common/flash/2006/shuqingwa.swf','http://www.61baobao.com/common/flash/2006/dpic/shuqingwa.gif','http://www.61baobao.com/common/flash/2006/pic/552.gif','0','三个月以上','0','','0','','0','0','0');");
