E_D("replace into `phome_ecms_game` values('3794','16','0','','','','1','admin','','1','0','1343236642','0','0','0','0','','','3794','0','0','0','0','0','0','猫和老鼠做朋友','1343236642','/spic/20120725/2280.jpg','0','1','1343236642','0','3','1','0','','0','','/d/file/swf/maohelaoshu0220.swf','667','479','　一只猫认识了一只老鼠，猫一再花言巧语地说自己非常喜欢老鼠，愿意同它交朋友。老鼠终于同意和猫住一间屋子，一起过日子。<br />猫说：“我们必须准备一些过冬的食物，不然我们就会挨饿。亲爱的老鼠，你可不能到处乱跑啊，我真担心你最终会闯到捕鼠器里去的。”','1','','0','','1','/dpic/20120725/2281.jpg','8901','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YUdJeWFHeGlSMFoyWXpKb01VMUVTWGxOUXpWNlpESlpQUT09','0','0','http://s.61baobao.com/common/flash/2006/maohelaoshu0220.swf','http://www.61baobao.com/common/flash/2006/dpic/maohelaoshu0220.jpg','http://www.61baobao.com/common/flash/2006/pic/1363.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3799','14','0','','','','1','admin','','1','0','1343236643','0','0','0','0','','','3799','0','0','0','0','0','0','快乐的节日','1343236643','/spic/20120725/2278.jpg','0','1','1343236643','0','3','1','0','','0','','/d/file/swf/kuaile.swf','667','479','','1','','0','','1','/dpic/20120725/2279.jpg','9150','VEROd01Fd3pSbkJpYlVwb1luazVjbVJYUm5CaVIxVjFZek5rYlE9PQ==','0','0','http://s.61baobao.com/zt/qinbao/kuaile.swf','http://www.61baobao.com/zt/qinbao/dpic/kuaile.jpg','http://www.61baobao.com/zt/qinbao/pic/kuaile.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('3800','16','1','','','','1','admin','','1','0','1343236643','0','0','0','0','','','3800','0','0','0','0','0','0','芝麻开门','1343236643','/spic/20120725/2286.gif','0','1','1343236643','0','3','1','0','','0','','/d/file/swf/houzichitaozi.swf','667','479','很久以前，在波斯国的某城市里住着兄弟俩，哥哥叫戈西母，弟弟叫阿里巴巴。父亲去世后，他俩各自分得了有限的一点财产，分家自立，各谋生路。不久银财便花光了，生活日益艰难。为了解决吃穿，糊口度日，兄弟俩不得不日夜奔波，吃苦耐劳。后来戈西母幸运地与一个富商的女儿结了婚，他继承了岳父的产业，开始走上做生意的道路。','1','','0','','1','/dpic/20120725/2287.gif','8900','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpvZG1SWWNIQlpNbWh3WkVkR2RtVnRhM1ZqTTJSdA==','1','0','http://s.61baobao.com/common/flash/2006/houzichitaozi.swf','http://www.61baobao.com/common/flash/2006/dpic/houzichitaozi.gif','http://www.61baobao.com/common/flash/2006/pic/553.gif','0','三个月以上','0','','0','','0','0','0');");
