E_D("replace into `phome_ecms_game` values('3822','16','0','','','','1','admin','','1','0','1343236647','0','0','0','0','','','3822','0','0','0','0','0','0','乌鸦七兄弟','1343236647','/spic/20120725/2340.gif','0','1','1343236647','0','3','1','0','','0','','/d/file/swf/laolang.swf','667','479','乌鸦七兄弟的故事 从前有一个人，他已经有七个儿子了，还想要个女孩，但是没有。后来他妻子怀孕了，生下来，果然是个女孩，夫妻俩分外高兴。美中不足的是，这女孩又瘦又小，体质很弱，他们只好为她举行“救急洗礼”，据说这样可以挽救她。','1','','0','','1','/dpic/20120725/2341.gif','8896','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREo0YUdJeWVHaGliV04xWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2006/laolang.swf','http://www.61baobao.com/common/flash/2006/dpic/laolang.gif','http://www.61baobao.com/common/flash/2006/pic/557.gif','0','三个月以上','0','','0','','0','0','0');");
