E_D("replace into `phome_ecms_game` values('3832','16','0','','','','1','admin','','1','0','1343236648','0','0','0','0','','','3832','0','0','0','0','0','0','寿命','1343236648','/spic/20120725/2433.gif','0','1','1343236648','0','3','1','0','','0','','/d/file/swf/woaiwodejia.swf','667','479','人和动物们商量分配寿命。人当时分配的寿命是二十岁。马是四十岁，但马说：“我一生劳碌，奔跑耕田，我愿意拿出二十岁来给人。”狗说：“我的寿命是二十岁，我看门守户，听命于人，我愿意拿出十岁来给人。”轮到猴子，猴子的寿命也是二十岁。猴子说：“我活的不好，我也愿意拿出十岁来给人。”最后是猫，猫也有二十岁的寿命，猫说：“我也听命于人，给一口吃一口。我愿意把十岁的寿命给人。”','1','','0','','1','/dpic/20120725/2435.gif','8894','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5rZGxsWGJETmlNbEpzWVcxc2FFeHVUak5hWnowOQ==','0','0','http://s.61baobao.com/common/flash/2006/woaiwodejia.swf','http://www.61baobao.com/common/flash/2006/dpic/woaiwodejia.gif','http://www.61baobao.com/common/flash/2006/pic/559.gif','0','三个月以上','0','','0','','0','0','0');");
