E_D("replace into `phome_ecms_game` values('4271','14','0','','','','1','admin','','1','0','1343236730','0','0','0','0','','','4271','0','0','0','1','0','0','每当我走过老师窗前','1343236730','/spic/20120725/5234.jpg','0','1','1343236730','0','3','1','0','','0','','/d/file/swf/meidang.swf','667','479','静静的深夜群星在闪耀<br />老师的房间彻夜明亮<br />每当我轻轻走过您窗前<br />明亮的灯光照耀我心房<br />啊，每当想起您，敬爱的老师<br />一阵阵暖流心中激荡<br />培育新一代辛勤的园丁<br />今天深夜啊仍在亮<br />呕心沥血您在写教材<br />高大的身影映在您窗上<br />啊，每当想起您，敬爱的老师<br />一阵阵暖流心中激荡<br />[采蘑菇的小姑娘]<br />晓光词谷建芬曲演唱：田蕙<br />采蘑菇的小姑娘，背着一个大箩筐<br />清早光着小脚丫，走遍树林河山冈<br />她采的蘑菇最多，多得像那星星数不清<br />她采的蘑菇最大，大得像那小伞装满筐<br />赛罗罗罗罗里赛罗哩赛，<br />赛罗罗罗罗罗哩赛罗哩赛<br />赛罗罗哩赛罗罗哩赛罗罗哩赛罗罗哩赛<br />罗罗罗哩赛。<br />谁不知那山里的蘑菇香<br />她却不肯尝一尝<br />盼到赶集的那一天，快快背到集市上<br />换上一把小镰刀，再换上几块棒棒糖<br />和那小伙伴一起，把劳动的幸福来分享<br />','1','','0','','1','/dpic/20120725/5235.jpg','8277','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YkdGWFVtaGliV04xWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2006/meidang.swf','http://www.61baobao.com/common/flash/2006/dpic/meidang.jpg','http://www.61baobao.com/common/flash/2006/pic/346.jpg','0','三个月以上','0','','0','','0','0','0');");
