E_D("replace into `phome_ecms_game` values('4276','14','0','','','','1','admin','|26|','1','0','1343236730','0','0','0','0','','','4276','0','0','0','1','0','0','卖花姑娘','1343236730','/spic/20120725/5240.jpg','0','1','1343236730','0','3','1','0','','0','','/d/file/swf/malanhua.swf','667','479','卖花来呦,卖花来呦，<br />朵朵红花多鲜艳，<br />花儿多香,花儿多鲜，<br />美丽的花儿红艳艳，<br />卖了花儿,来呦来呦，<br />治好生病的好妈妈，<br />卖花来呦,卖花来呦，<br />朵朵鲜花红艳艳，<br />从小河边摘来了粉红色的八仙花，<br />从山坡上采来了美丽的金达莱，<br />卖花来呦,卖花来呦，<br />快快来买这束花，<br />让这鲜花和那春光洒满痛苦的胸怀。<br /><br />卖花来呦,卖花来呦<br />花儿好啊红又香<br />朵朵红花卖不完呐<br />滴滴眼泪流不完<br />没有祖国没有权<br />生活之路遇终端<br />在这春暖花开之时<br />终日卖花泪不干<br />卖花来呦,卖花来呦<br />朵朵红花多鲜艳<br />花儿多香,花儿多鲜<br />美丽的花儿红艳艳<br />卖花来呦,卖花来呦<br />花儿好啊红又香<br />朵朵红花卖不完呐<br />滴滴眼泪流不完<br />朵朵红花卖不完呐<br />滴滴眼泪流不完','1','','0','','1','/dpic/20120725/5241.jpg','8276','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU1qRm9Za2RHZFdGSVZtaE1iazR6V21jOVBRPT0=','0','0','http://s.61baobao.com/zt/qinbao/2012/malanhua.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/malanhua.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/malanhua.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('4280','14','0','','','','1','admin','|24|','1','0','1343236731','0','0','0','0','','','4280','0','0','0','1','0','0','四季的歌','1343236731','/spic/20120725/5238.jpg','0','1','1343236731','0','3','1','0','','0','','/d/file/swf/0205.swf','667','479','春天到黄莺叫黄莺叫<br />杨柳枝随风飘随风飘<br />桃花李花开得好<br />小蜜蜂嗡嗡叫采蜜兴致高<br />嗡……嗡……<br />采蜜兴致高<br /><br />夏天到知了叫知了叫<br />树林里真热闹真热闹<br />清水池塘荷花飘<br />小青蛙咯咯叫捉虫本领高<br />咯……咯……<br />捉虫本领高<br /><br />秋天到蟋蟀叫蟋蟀叫<br />树上落叶随风飘随风飘<br />满园菊花都开了<br />小螃蟹真可笑走路横着跑<br />哈……哈……<br /><br />冬天到乌鸦叫乌鸦叫<br />天上雪花飘雪花飘<br />腊梅花开在树梢<br />小花猫喵喵叫炉边把火烤<br />喵……喵……<br />炉边把火烤<br />','1','','0','','1','/dpic/20120725/5239.jpg','8284','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1RE9IZE5ha0V4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/04/0205.swf','http://www.61baobao.com/common/flash/2011b/04/dpic/0205.jpg','http://www.61baobao.com/common/flash/2011b/04/pic/0205.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('4281','14','0','','','','1','admin','|24|26|','1','0','1343236731','0','0','0','0','','','4281','0','0','0','1','0','0','妈妈和我','1343236731','/spic/20120725/5142.jpg','0','1','1343236731','0','3','1','0','','0','','/d/file/swf/3473.swf','667','479','童年的时候，妈妈对我说，天上的星星千颗万颗，<br />有一颗星星就是我，而我是星星 星星是我，<br />妈妈`那你是什么是什么，妈妈。那你是什么是什么，<br />少年的时候，妈妈对我说，春天鲜花千朵万朵，<br />有一朵鲜花就是我，而我是鲜花 鲜花是我，<br /> 妈妈那你是什么是什么，妈妈那你是什么是什么，<br />长大的时候，妈妈对我说，大海的浪花千朵万朵，<br />有一朵浪花就是我，而我是浪花浪花是我，<br />妈妈。那你是什么是什么，妈妈那你是什么是什么，<br />妈妈吖妈妈要我对你说，如果我是春天的花朵，<br />如果我是我是浪花，你就是月亮你就是太阳，<br />你就是一条流进我心中的河，你就是一条流进我心中的河，妈妈```','1','','0','','1','/dpic/20120725/5143.jpg','8270','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVrMHdUbnBOZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/3473.swf','http://www.61baobao.com/common/flash/d/dpic/3473.jpg','http://www.61baobao.com/common/flash/d/pic/3473.jpg','0','三个月以上','0','','0','','0','0','0');");
